#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <stdbool.h>

int lengthOfLongestSubstring(char *s) {
    int ans = 0;
    int ans_tmp = 0;

    char *str = s;
    char *subStr = (char *) calloc(1, strlen(s) + 1);

    for (int i = 0; i < strlen(str); ++i) {
        bool flag = false;
        for (int j = 0; j < strlen(subStr); ++j) {  //Check if the new element is in the subStr
            if (subStr[j] == str[i]) {
                flag = true;                        //Set duplication flag
                break;
            }
        }

        if (!flag) {                    //If the new element is not duplicated,
            subStr[i] = str[i];         //copy the new element to subStr
            ans_tmp = strlen(subStr);   //Record the temp subStr length
        } else {
            ans = (ans_tmp>ans)?ans_tmp:ans;                //Get the MAX one
            memset((char *)subStr, 0, strlen(subStr) + 1);  //Clear the subStr memory

            str++;
            //str += ((ans - 4)>0?ans-4:1);     //Add the str left window with ans. not use str++, due to subStr should not be duplicated.
            i = -1;         //Search from the beginning of the new str
        }
    }

    return (ans>ans_tmp)?ans:ans_tmp;
}


